	(226,1,'2019-10-29 13:09:36','2019-10-29 13:09:36','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://platform.test/wp/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','About us','','inherit','closed','closed','','2-revision-v1','','','2019-10-29 13:09:36','2019-10-29 13:09:36','',2,'http://platform.test/2-revision-v1/',0,'revision','',0),
