	(18,1,'ptwp_yoast_notifications','a:1:{i:0;a:2:{s:7:\"message\";s:1166:\"<strong>Upgrade WordPress to the most recent version</strong><br/>We’ve noticed that you’re not on the latest WordPress version, which might cause an issue soon. Yoast (for reasons of security and stability) only supports the current and previous version of WordPress. When the next version of WordPress comes out, that means that we will support WordPress 5.2 and 5.3. This means you will not get any updates to Yoast SEO until you update your WordPress, so please make sure to upgrade to the latest WordPress version soon!<br/><br/>If you’ve held off on updating to 5.0 and higher because of the new Gutenberg editor, please install the Classic Editor plugin. It will give you the same editing experience you have now, but also the security of newer versions of WordPress and Yoast SEO.<br/><br/>Read <a href=\"https://yoa.st/old-wp-support?php_version=7.1&platform=wordpress&platform_version=4.9.8&software=free&software_version=12.4-RC1&days_active=6-30&user_language=en_US\" target=\"_blank\" rel=\"nofollow\">this post for more information about why we’re not supporting older versions.<span class=\"screen-reader-text\">(Opens in a new browser tab)</span></a>\";s:7:\"options\";a:9:{s:4:\"type\";s:5:\"error\";s:2:\"id\";s:31:\"wpseo-dismiss-wordpress-upgrade\";s:5:\"nonce\";N;s:8:\"priority\";d:0.5;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";a:1:{i:0;s:20:\"wpseo_manage_options\";}s:16:\"capability_check\";s:3:\"all\";s:14:\"yoast_branding\";b:0;}}}'),
